var _Assets7dee1c2c32a84b6c983663a8c680a48b16efd35f = "<!DOCTYPE html>\n<html lang=\"en\">\n  <head>\n    <meta charset=\"utf-8\">\n    <meta http-equiv=\"X-UA-Compatible\" content=\"IE=edge\">\n    <meta name=\"viewport\" content=\"width=device-width, initial-scale=1\">\n    <link rel=\"icon\" href=\"favicon.png\">\n    <title>XD WebUI</title>\n    <link href=\"xd.css\" rel=\"stylesheet\">\n  </head>\n  <body>\n    <noscript> XD WebUI is injected via Javascript &gt;:DDDDD </noscript>\n\n    <div id=\"confirmation-box\" class=\"confirmation-box\" data-bind=\"visible: confirmation.show\">\n        <div class=\"confirmation-content\">\n            <p><b>Remove torrent?</b></p>\n            <p><input type=\"checkbox\" data-bind=\"checked: confirmation.deleteFiles\"> Delete local files</p>\n            <p><input type=\"checkbox\" data-bind=\"checked: confirmation.silent\"> Don't show this dialog again</p>\n            <div class=\"row\">\n                <div class=\"six columns\">\n                    <input class=\"u-full-width button-primary\" type=\"submit\"\n                           data-bind=\"click: confirmation.confirmed\" value=\"Yes\">\n                </div>\n                <div class=\"six columns\">\n                    <input class=\"u-full-width button-primary button-cancel\" type=\"submit\"\n                           data-bind=\"click: confirmation.close\" value=\"Cancel\">\n                </div>\n            </div>\n        </div>\n    </div>\n\n    <div class=\"base container u-full-width\">\n        <nav>\n            <div class=\"row\">\n                <div class=\"one columns logo\">\n                  <img src=\"favicon.png\" />\n                </div>\n                <div class=\"nine columns\">\n                  <input class=\"u-full-width\" type=\"text\"\n                      placeholder=\"Torrent location (URL or local file)\"\n                      data-bind=\"value: torrentURL\"\n                      id=\"torrent-url-input\">\n                </div>\n                <div class=\"two columns\">\n                  <input class=\"u-full-width button-primary\" type=\"submit\"\n                      data-bind=\"click: addTorrent\"\n                      value=\"Add\">\n                </div>\n            </div>\n            <div class=\"row\">\n                <div class=\"six columns filter-panel\">\n                  <ul data-bind=\"foreach: torrentStates\" class=\"filter-buttons\">\n                      <li class=\"four columns\" data-bind=\"css: { 'active': $root.torrentFilter() == $data }, text: $data, click: function (data, event) { $root.setFilter($data) }\"></li>\n                  </ul>\n                </div>\n                <div class=\"six columns speed\" data-bind=\"text: globalInfo()\"></div>\n            </div>\n        </nav>\n\n          <div data-bind=\"foreach: torrents\">\n              <div data-bind=\"css: 'torrent-row-' + $data.State\" class=\"row torrent-row\">\n                  <div class=\"ten columns\">\n                      <div>\n                          <span data-bind=\"text: Name\"></span>\n                      </div>\n                      <div><span data-bind=\"text: $data.TotalSize()\"></span> <span data-bind=\"text: $data.State\"></span></div>\n                      <div><progress data-bind=\"value: $data.Progress\" max=\"100\"></progress></div>\n                      <div><span data-bind=\"text: $data.Peers()\"></span> peers connected. <span data-bind=\"text: $data.Ratio()\"></span><span data-bind=\"text: $data.Speed()\"></span></div>\n                  </div>\n                  \n                  <div class=\"two columns torrent-button\">\n                    <span class=\"button-remove\" data-bind=\"click: $data.toggle, text: $data.StatusButton()\" title=\"Resume torrent\"></span>\n                  </div>\n                  <div class=\"two columns torrent-button\">\n                    <span class=\"button-remove\" data-bind=\"click: remove\" title=\"Remove torrent and delete files\">❌</span>\n                  </div>\n              </div>\n          </div>\n      </div>\n\n      <script src=\"xd.min.js\"></script>\n  </body>\n</html>\n"
